/*
You are given a string, s, and a list of words, words, that are all of the same length. Find all starting indices of substring(s) in s that is a concatenation of each word in words exactly once and without any intervening characters.

 

Example 1:

Input:
  s = "barfoothefoobarman",
  words = ["foo","bar"]
Output: [0,9]
Explanation: Substrings starting at index 0 and 9 are "barfoo" and "foobar" respectively.
The output order does not matter, returning [9,0] is fine too.
Example 2:

Input:
  s = "wordgoodgoodgoodbestword",
  words = ["word","good","best","word"]
Output: []

*/

#include<iostream>
#include <vector>
#include <unordered_map>


using namespace std;

vector<int> findString( const string& str,const vector<string>& words)
{
	int l = words.size();
	//cout << str << "\n";
	//for( int i =0;i<words.size();i++)
    //	cout << words[i] << "\n";
	unordered_map<string, int> wordCat;
	vector<int> res;
	int size = words[0].size();
	int count =l;
	int n = str.size();
	for ( int i = 0;i<l;i++)
	{
		wordCat[words[i]]++;
		//cout << wordCat[words[i]];

	}

	for( int i=0;i<n-size; i++)
	{
		unordered_map<string,int> temp_map(wordCat);
		int j=i;
		count =l;
		while(j< n)
		{
			string word=str.substr(j,size);
			//cout << word << "\n";
			if(temp_map.find(word)==temp_map.end() || temp_map[word] ==0)
				break;
			else
			{
				count--;
				temp_map[word]--;
				//cout << count ;

			}
			j+=size;

		}
		if(count==0)
			res.push_back(i);
	}

	return res;
}


